Cimp2new[n_,mu_,x_,J_] := Table[Cimp2list[i,mu,x][[J/2+1]],{i,3/2,num1,1}] . coefflist[[n-3/2]];
Gn[n_, D_, b_, mu_] := Table[G[i, D, b, mu],{i,3/2,num1,1}] . coefflist[[n-3/2]];
Bn[n_, D_, b_, mu_] := Table[B[i, D, b, mu],{i,3/2,num1,1}] . coefflist[[n-3/2]];
Fn[n_, D_, b_, mu_] := Table[F[i, D, b, mu],{i,3/2,num1,1}] . coefflist[[n-3/2]];
Hn[n_, D_, b_, mu_] := Table[H[i, D, b, mu],{i,3/2,num1,1}] . coefflist[[n-3/2]];
Xlist4new[n_,mu_,x_,J_] := Table[Xlist4[i,mu,x][[J/2+1]],{i,3/2,num1,1}] . coefflist[[n-3/2]];
Xlist6new[n_,mu_,x_,J_] := Table[Xlist6[i,mu,x][[J/2+1]],{i,3/2,num1,1}] . coefflist[[n-3/2]];
Xlist8new[n_,mu_,x_,J_] := Table[Xlist8[i,mu,x][[J/2+1]],{i,3/2,num1,1}] . coefflist[[n-3/2]];
Xlist10new[n_,mu_,x_,J_] := Table[Xlist10[i,mu,x][[J/2+1]],{i,3/2,num1,1}] . coefflist[[n-3/2]];


Poly[J_, x_, y_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,y],{{Flatten[{Table[Cimp2new[n,mu1,x,J],{n,5/2,num1}], Table[Xlist4[n,mu1,x][[J/2+1]] ,{n,0,nulllist[[1]]}], Table[Xlist6[n,mu1,x][[J/2+1]],{n,0,nulllist[[2]]}], Table[Xlist8[n,mu1,x][[J/2+1]],{n,0,nulllist[[3]]}], Table[Xlist10[n,mu1,x][[J/2+1]],{n,0,nulllist[[4]]}]}]}}];

NewPoly[b_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,x],{{Flatten[{Table[(Gn[i, 10, Sqrt[mu1]*b, mu1] + Bn[i, 10, Sqrt[mu1]*b, mu1]),{i,5/2,num1}], list0}],Flatten[{Table[(Fn[i, 10,Sqrt[mu1]*b, mu1]),{i,5/2,num1}], list0}]},
        {Flatten[{Table[(Fn[i, 10, Sqrt[mu1]*b, mu1]),{i,5/2,num1}], list0}],Flatten[{Table[(Gn[i, 10, Sqrt[mu1]*b, mu1] - Bn[i, 10, Sqrt[mu1]*b, mu1]),{i,5/2,num1}], list0}]}}];

Polydis[b_, x_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,x],{{Flatten[{Table[H[n,10,b, mu1],{n,5/2,num1}], list0}]}}]        
